import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import TopNav from "../components/TopNav/TopNav";
import Button from "../components/Button/Button"

const Cart = () => {
  return (
    <div>
      <TopNav />
      <h1>장바구니</h1>
      <Link to="/">
        <Button>홈으로 이동</Button>
      </Link>
    </div>
  );
};

export default Cart;
